    const [post, setPost] = useState({});

    useEffect(() => {
        axios.get('http://dummy.restapiexample.com/api/v1/employees')
            .then(response => {
                setLoading(false)
                setPost(response.data)
                setError('')
            })
            .catch(error => {
                setLoading(false)
